CXXPORTABILITY= -DSPEC_CPU_LINUX -include cstdlib -include cstring -include stddef.h

447.dealII=default:
CXXPORTABILITY= -DSPEC_CPU_LINUX -include cstdlib -include cstring -include stddef.h 

482.sphinx3=base=aarch64_linux=default:
